// SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

import "openzeppelin-solidity/contracts/access/Ownable.sol";
import "openzeppelin-solidity/contracts/token/ERC1155/ERC1155.sol";
import "openzeppelin-solidity/contracts/utils/Strings.sol";

contract OwnableDelegateProxy { }

contract ProxyRegistry {
  mapping(address => OwnableDelegateProxy) public proxies;
}

contract LastWord is ERC1155, Ownable {
    address proxyRegistryAddress;
    string baseUri = "https://leave-a-mark-in-meta.herokuapp.com/api/token/";
    mapping(uint256 => string) id_to_mark;
    uint256 mintedWords = 0;
    uint256 constant MAX_NUM_WORDS = 100000;

    constructor(
        address _proxyRegistryAddress
    ) ERC1155(baseUri) {
        proxyRegistryAddress = _proxyRegistryAddress;
    }

    function mint(
        address _to,
        string memory _name,
        string memory _word,
        bytes memory _data
    ) external payable returns(uint256){
        if (msg.sender != owner()) {
            require(msg.value >= 0.01 ether, "claiming a token costs 10 finney");
            payable(owner()).transfer(msg.value);
        }
        require(mintedWords <= MAX_NUM_WORDS, "All 10k tokens have been minted - there's no spot left.");

        // Generate an id according to the mark
        uint256 tokenId = id(_name);
        require(bytes(id_to_mark[tokenId]).length == 0, "This id has been claimed!");

        string memory _theMark = string(
            abi.encodePacked(_name, ":", _word)
        );

        _mint(_to, tokenId, 1, _data);
        id_to_mark[tokenId] = _theMark;
        mintedWords += 1;
        return tokenId;
    }

    function id(string memory name) internal pure returns(uint256) {
        // Psudo random id generator
        return uint256(keccak256(abi.encode(name)));
    }

    function get_mark(uint256 tokenId) external view returns (string memory mark) {
        require(bytes(id_to_mark[tokenId]).length != 0, "This id has not been claimed!");
        string memory theMark = id_to_mark[tokenId];
        return theMark;
    }

    function get_id(string memory name) external view returns (uint256 id_of_mark) {
        id_of_mark = id(name);
        require(bytes(id_to_mark[id_of_mark]).length != 0, "This mark has not been claimed!");
        return id_of_mark;
    }

    function uri(
        uint256 _id
    ) override public view returns (string memory) {
        // We have to convert string to bytes to check for existence
        return string(
            abi.encodePacked(baseUri, Strings.toString(_id))
        );
    }

    function setURI(
        string memory _newURI
    ) public onlyOwner {
        baseUri = _newURI;
    }

    /**
   * Override isApprovedForAll to whitelist user's OpenSea proxy accounts to enable gas-free listings.
   */
    function isApprovedForAll(
        address _owner,
        address _operator
    ) override public view returns (bool isOperator) {
        // Whitelist OpenSea proxy contract for easy trading.
        ProxyRegistry proxyRegistry = ProxyRegistry(proxyRegistryAddress);
        if (address(proxyRegistry.proxies(_owner)) == _operator) {
        return true;
        }

        return ERC1155.isApprovedForAll(_owner, _operator);
    }
}
